import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
     <nav className='flex justify-items-center'>
      <div className="">
        <img src='./Images/brand_logo.png'></img>
      </div>
      <ul>
        <li href="#">Menu</li>
        <li href="#">Location</li>
        <li href="#">About</li>
        <li href="#">Contact</li>
      </ul>
      <button className='border'>
        Login
      </button>
      </nav> 
    </div>
  );
}

export default App;
